// Header.js
import React from 'react';
import { Link } from 'react-router-dom'; // useNavigate is not necessary if using Link
import MenuItem from './MenuItem'; // Make sure to import MenuItem component
import './Header.css'; // Import your header styles

function Header() {
  // useNavigate can be removed if not needed elsewhere

  return (
    <header className="header">
      <nav>
        <ul className="menu-list">
          <MenuItem label="About" />
          <li className="menu-item"> {/* Adjust the div to li if necessary */}
            {/* Use Link component for navigation */}
            <Link to="/Projects">
              <button type="button">
                Projects
              </button>
            </Link>
          </li>
          <MenuItem label="Courses" />
          <MenuItem label="Contact" />
        </ul>
      </nav>
    </header>
  );
};

export default Header;
